eval("module.exports = {\"services\":[{\"title\":\"Cocinas\",\"tag\":\"cocina\",\"description\":\"La cocina es definitivamente el corazn de la casa. Uno de los lugares ms frecuentados en las casas, es la cocina, debido a que all se realiza la preparacin de los alimentos diarios, por lo que esta debe estar bien distribuida y cmoda. \\n  Estos espacios forman la base de la vida familiar, desde entretener a amigos y seres queridos, hasta reunirse para comer y conversar. Perfeccionar este equilibrio significa disear un espacio que sea funcional y atractivo, y eso significa invertir en las mejores cocinas.\",\"url\":\"../img/fondo_cocina.jpg\",\"_id\":1},{\"title\":\"Piscinas\",\"tag\":\"piscina\",\"description\":\"Buscamos satisfacer las necesidades de nuestros clientes ofreciendo diferentes soluciones de manera que el resultado final siempre supera las expectativas iniciales. \\n No slo construimos la piscina de tus sueos, tambin  nos hacemos cargo de reformar tu piscina trabajamos siempre con los mejores materiales.  Pide tu informacin sin compromiso.\",\"url\":\"../img/fondo_piscina.jpeg\",\"_id\":2},{\"title\":\"Pinturas de viviendas\",\"tag\":\"pintura\",\"description\":\"T eres nico y tu nuevo espacio tambin lo ser. Por ello cada diseo es personalizado y exclusivo. En todos nuestros trabajos de pintura y decoracin utilizamos los mejores materiales y las tcnicas ms innovadoras. \\n Cmo quieres decorar tu espacio? Buscas un espacio de estilo clsico, moderno, rstico, vintage? O quizs quieras modernizar tu espacio y darle otra apariencia? Si an no lo tienes claro, estaremos de acuerdo en algo: buscas una casa con alma y personalidad. \\n Para conseguir un perfecto proyecto de decoracin para tu vivienda, local u oficina, nuestros diseadores e interioristas trabajarn conjuntamente incorporando tus gustos y necesidades al proyecto, para que ste pueda funcionar y enriquecer tu calidad de vida.\",\"url\":\"../img/fondo_pintura.jpg\",\"_id\":3},{\"title\":\"Carpinteria\",\"tag\":\"carpinteria\",\"description\":\"Nuestra carpintera se especializa por la tradicin y la pulcritud. En nuestras reformas, disponemos de carpinteros especializados. De esta manera, podemos realizar diseos y hacer el mueble que necesites. \\n Los espacios de almacenaje, siempre son necesarios, y nosotros aprovechamos cada espacio, para darle una utilidad. \\n Hacemos muebles de cocina, muebles de bao, Muebles para habitaciones y salones.\",\"url\":\"../img/fondo_carpinteria.jpg\",\"_id\":4},{\"title\":\"Solares\",\"tag\":\"solares\",\"description\":\"\",\"url\":\"../img/services_cerrajeria.jpg\",\"_id\":5},{\"title\":\"Reforma Integral\",\"tag\":\"reforma_integral\",\"description\":\"Al igual que los clientes que ya han confiado en nosotros, te ofreceremos grandes ideas en diseo y multitud de posibles combinaciones para hacer la reforma de tu vivienda. \\n Te daremos asesoramiento personalizado y recomendaciones para tu nuevo proyecto. Sabemos cmo trabajar y combinar todos los materiales a emplear para que todo quede perfecto, siempre teniendo en cuenta la mejor relacin calidad-precio de todos los productos a emplear en la reforma de su cocina, bao o vivienda en general. \\n Si quieres hacer de la reforma de tu negocio una inversin y adaptarlo a tus necesidades e ideas. Te recomendaremos los mejores materiales en trminos de calidad, funcionalidad y fiabilidad existentes en el mercado.\",\"url\":\"../img/fondo_reforma-integral.jpg\",\"_id\":6},{\"title\":\"Demoliciones\",\"tag\":\"demolicion\",\"description\":\"Nos especializamos en brindar Servicios profesionales de demolicin de casas, departamentos, etc. Toda demolicin comienza con el estudio de nuestro equipo tcnico, el cual una vez desplazado al lugar de trabajo, en funcin de las caractersticas de cada obra y de su entorno elabora un plan de trabajo en el cual prev los medios mecnicos y manuales que se requieren para realizar con seguridad y eficacia cada trabajo.\",\"url\":\"../img/fondo_demolicion.jpg\",\"_id\":7},{\"title\":\"Construccin General\",\"tag\":\"construccion_general\",\"description\":\"Nos encargamos de hacer realidad su proyecto de uso residencial, comercial, empresarial. Nuestro equipo de arquitectos y mano de obra se ofrece para planificar, construir, remodelar y mejorar los espacios que necesiten una especial atencin. \\n Asimismo asesoramos a nuestros clientes a la hora de tomar decisiones de construccin, decorativas y econmicas. Todos nuestros proyectos de construccin finalizan de la misma manera: con una satisfaccin plena por parte de nuestros clientes.\",\"url\":\"../img/fondo_construcciones-general.jpg\",\"_id\":8}]};\n\n//# sourceURL=webpack:///./src/data/services.json?");

